<script setup>
import { useRouter, useRoute } from "vue-router";
import ModelFormOpenAiVue from "./openai/ModelForm.vue";
import ModelFormWebLlmVue from "./web-llm/ModelForm.vue";
import ModelFormHuggingFaceVue from "./huggingface/ModelForm.vue";
import ModelFormCurlVue from "./curl/ModelForm.vue";
import ModelFormValidator from "../grammars/ModelFormValidator.vue";
import { fetchModel, createModel, updateModel } from "./openai/modelService.js";
import { initialValues } from "./consts.js";
import { onMounted, ref, reactive, watch } from "vue";

const SERVER_URL = `${import.meta.env.VITE_SERVER_URL || "http://localhost:5000"}`;

const route = useRoute();
const router = useRouter();

const loading = ref(false);

const model = reactive({
    id: null,
    developer: null,
    modelType: null,
    apiKey: "",
    showApiKey: false,
    name: null,
    temperature: 0.2,
    maximumLength: 4095,
    topP: 1,
    repetitionPenalty: 0,
    stopSequences: [";", "###"],
    seed: 6,
    grammarType: { name: "Langium", code: "langium" },
    description: null,
    definition: null,
    definitionExamples: [
        { "userInstruction": "", "modelAnswer": "" }
    ],
    activeTab: 0,
    singleStopSequence: ""
});


const modelDeveloperItems = [
    { code: "openai", name: "OpenAI" },
    { code: "webllm", name: "WebLLM" },
    { code: "huggingface", name: "Hugging Face" },
    { code: "curl", name: "Curl Custom Model" },
];

const errors = ref({});
const errorTabs = ref({});

onMounted(async () => {
    if (route.params.id) {
        loading.value = true;
        await fetchModel(SERVER_URL, route.params.id).then((res) => {
            model.developer = res.developer;
            model.modelType = res.modelType;
            model.name = res.name;
            model.apiKey = res.apiKey;
            model.temperature = res.temperature;
            model.maximumLength = res.maximumLength;
            model.topP = res.topP;
            model.repetitionPenalty = res.repetitionPenalty;
            model.stopSequences = res.stopSequences;
            model.seed = res.seed;
            model.description = res.description;
            model.definition = res.definition;
            model.definitionExamples = res.definitionExamples;
        }).finally(() => {
            loading.value = false;
        });
        return;
    }

    // Check if the model type is passed in the query string and is valid
    if (
        router.currentRoute.value.query.m &&
        modelDeveloperItems.find((item) => item.code === router.currentRoute.value.query.m.toLowerCase())
    ) {
        model.developer = router.currentRoute.value.query.m;
    } else {
        router.push({ name: "NotFound" });
        return;
    }
});

const resolver = async (values) => {
    errors.value = {};
    errorTabs.value = {};

    if (!model.name || model.name == "") {
        errors.value.modelName = [{ message: 'ModelName is required.' }];
        errorTabs.value[0] = true;
    }

    if (!model.description || model.description == "") {
        errors.value.description = [{ message: 'Description is required.' }];
        errorTabs.value[0] = true;
    }

    if (!model.definition || model.definition == "") {
        errors.value.definition = [{ message: 'Model grammar definition is required.' }];
        errorTabs.value[2] = true;
    }

    if (!model.modelType || model.modelType == "") {
        errors.value.modelType = [{ type: 'required', message: 'Model Type is required.' }];
        errorTabs.value[1] = true;
    }

    if (model.developer == "openai" && (!model.apiKey || model.apiKey == "")) {
        errors.value.apiKey = [{ message: 'API Key is required' }];
        errorTabs.value[1] = true;
    }

    return {
        errors: errors.value,
        values: model,
    }
};

const onFormSubmit = async (valid) => {
    if (!valid || Object.keys(valid.errors).length > 0) {
        return;
    }

    let res;
    loading.value = true;

    if (model.id) {
        res = await updateModel(SERVER_URL, model.id, model);
    } else {
        res = await createModel(SERVER_URL, model);
    }

    if (res.errors) {
        // errors.value = res.error;
        loading.value = false;
        return;
    }

    loading.value = false;
    router.push({ name: "ModelChat", params: { id: res.name } });
};

const changeModelDeveloper = (type) => {
    model.developer = type.value;
    model.modelType = null;
}

// watch the model and execute the validation
watch(model, (newVal) => {
    resolver(newVal);
}, { deep: true });

</script>
